Male
– Base of head horn (
Fig. 218-219
) with convergent sides, anterior surface at most only weakly concave, lateral angles acutely tuberculate; central process conspicuously shorter than base, at most only weakly inclined posteriorly, evenly curved posteriorly and never tuberculate or angulate on posterior surface. Pronotal prominence (
Fig. 275-276
) bilobate, saddle-shaped, never with acute lateral lobes, flanked by shallow concavities; width less than distance between outer margins of eyes.
